import React, { Component } from "react";
import uniqid from "uniqid";

export class WorkExp extends Component {
  constructor() {
    super();
    this.state = {
		work: {
			Company: {
				placeholder: "Company",
				value: "Google",
			},
			Position: {
				placeholder: "Position",
				value: "Software Engineer",
			},



        defaultStart: "",
        startDate: "2021-2",
        defaultEnd: "2021-05",
        endDate: "",
      },
      works: [],
    };
  }

  handleChange = (e) => {
    this.setState({
      [e.target.id]: {
        placeholder: this.state[e.target.id].placeholder,
        value: e.target.value,
      },
    });
  };

  render() {
    return <div></div>;
  }
}

export default WorkExp;
